import React from 'react';
import { Route, Redirect } from 'react-router-dom';

export default function PrivateRoute({ component: Component, ...rest }) {
    return (
        <Route
            {...rest}
            render={props => (
                props.isLoggedIn ? ( <Component {...props} /> ) : console.log('>> PrivateRoute', this.props) )
            }
        />
    );
};

